import React, { useState, useEffect } from "react";

const UsersPage = () => {
  const [data, setData] = useState([]);
  const [visibleColumns, setVisibleColumns] = useState([
    "ReqId",
    "FullName",
    "EmailID",
    "Role",
    "DOB",
    "ReqSkills",
    "ReqCreationDate",
    "ReqTitle",
    "ImmigrationStatus",
