  return (
    <div className="Users Table flex">
      <Sidebar />
      <div className="flex-1 overflow-x-auto relative shadow-md sm:rounded-lg m-8">
        {/* Filter Button aligned to the right */}
        <div className="flex justify-end mb-4">
          <button
            onClick={() => setIsFilterVisible(!isFilterVisible)}
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
          >
            Filter
          </button>
          {isFilterVisible && (
            <div
              className="absolute z-10 bg-white p-4 shadow-lg rounded"
              style={{ minWidth: "200px", right: "10px" }} // Ensure dropdown does not shrink
            >
              {allColumns.map((column) => (
                <div key={column} className="flex items-center">
                  <input
                    type="checkbox"
                    id={column}
                    checked={visibleColumns.includes(column)}
                    onChange={() => toggleColumnVisibility(column)}
                  />
                  <label htmlFor={column} className="ml-2">
